import React, { Component, useState, useEffect } from 'react';
import { Container, Row, Col } from "react-bootstrap";
import { BrowserRouter, Routes, Route, Link , } from "react-router-dom";
import Film from './Film';
import axios from "axios";

//multiple films rendering in a list

const FilmsHeader = () => {
  return (
    <Row>
      <Col>IMG</Col>
      <Col>GRADE</Col>
      <Col>TITLE</Col>
      <Col>PREMIERE</Col>
    </Row>
  )
}

const FilmDiv = (props) => {
  return (
    <Link to={`/film/${props.data.id}`}>
      <Row className = "filmDiv">
          <Col></Col>
          <Col className="filmInfo">IMG</Col>
          <Col className="filmInfo">{props.data.avgGrade}</Col>
          <Col className="filmInfo">{props.data.title}</Col>
          <Col className="filmInfo">{props.data.premiereDate}</Col>
          <Col></Col>
      </Row>
    </Link>
  )
}

const FilmsContainer = () => {
  const [list, setList] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:8080/api/film/ranking/0")
    .then(res => {
      console.log(res.data)
      setList(res.data)
    })
    .catch(err => {
      console.log(err)
    })
  }, [setList]);

  return (
    <div className="filmsContainer">
      {list.map(film => (<FilmDiv key={film.id} data={film} />))}
    </div>
  )
}

const Ranking = () => {
  return (
    <Container fluid>
      <h1>Films</h1>
      <FilmsContainer/>
    </Container>
  )
}

export default Ranking;
